export function ShowAdmins({ adminList }) {
  return (
    <div className="">
      <h1 className="pb-2">List Of Admins</h1>
      <table className="table table-striped">
        <tbody className="">
          <tr>
            <th>Id</th>
            <th>Full Name</th>
            <th>Phone</th>
            <th>Email</th>
            <th>Password</th>
            <th>
              <Link to="new">
                <Button
